import { Link } from "react-router-dom"
const Images = ({images}) =>{

    return(
        <>
        <ul className="card">
            {images.map(image => (
            <li key={image.id}><Link to={`/${image.id}`}><img src={image.src} alt={image.alt}/></Link></li>
            ) )}
        </ul>
        </>
    )
}

export default Images
